import { createIcon } from "../icon/createIcon";

export const TriangleUpIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="TriangleUpIcon">
    <path d="m1 8.5 5-5 5 5z" />
  </svg>,
  "TriangleUp",
  "triangle up"
);
